// App.js
import { useState } from 'react';
import { Grid, TextField, Chip, Paper, Typography, Button, IconButton } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import EventSeatIcon from '@mui/icons-material/EventSeat';

// Mock data
const events = [
  {
    id: 1,
    name: "The Avengers: Finale",
    date: "2025-03-15",
    venue: "Cineplex 12 Screen 5",
    seats: [
      { id: 'A1', type: 'VIP', price: 1200, available: true },
      { id: 'A2', type: 'VIP', price: 1200, available: false },
      { id: 'B1', type: 'Regular', price: 800, available: true },
      // ... more seats
    ]
  }
];

const SeatMap = ({ seats, onSelect }) => {
  return (
    <Grid container spacing={1} sx={{ maxWidth: 600 }}>
      {seats.map(seat => (
        <Grid item xs={1} key={seat.id}>
          <IconButton
            color={seat.available ? "primary" : "error"}
            disabled={!seat.available}
            onClick={() => onSelect(seat)}
          >
            <EventSeatIcon fontSize="large" />
          </IconButton>
          <Typography variant="caption">
            {seat.price}₹
          </Typography>
        </Grid>
      ))}
    </Grid>
  );
};

const BookingSummary = ({ selectedSeats }) => {
  const total = selectedSeats.reduce((sum, seat) => sum + seat.price, 0);

  return (
    <Paper sx={{ p: 2, mt: 2 }}>
      <Typography variant="h6">Booking Summary</Typography>
      {selectedSeats.map(seat => (
        <div key={seat.id}>
          {seat.id} - {seat.type} Seat: ₹{seat.price}
        </div>
      ))}
      <Typography sx={{ mt: 2 }}>Total: ₹{total}</Typography>
      <Button variant="contained" sx={{ mt: 2 }}>Confirm Booking</Button>
    </Paper>
  );
};

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedSeats, setSelectedSeats] = useState([]);
  const [filters, setFilters] = useState({
    seatType: 'all',
    priceRange: 'all'
  });

  const handleSeatSelect = (seat) => {
    setSelectedSeats(prev => 
      prev.some(s => s.id === seat.id) 
        ? prev.filter(s => s.id !== seat.id)
        : [...prev, seat]
    );
  };

  return (
    <div style={{ padding: 20 }}>
      {/* Search and Filters */}
      <TextField
        fullWidth
        placeholder="Search events..."
        InputProps={{
          startAdornment: <SearchIcon />
        }}
        sx={{ mb: 2 }}
        onChange={(e) => setSearchQuery(e.target.value)}
      />

      <div style={{ marginBottom: 20 }}>
        <Chip label="VIP Seats" onClick={() => setFilters({...filters, seatType: 'VIP'})} />
        <Chip label="Regular Seats" onClick={() => setFilters({...filters, seatType: 'Regular'})} />
        <Chip label="All Seats" onClick={() => setFilters({...filters, seatType: 'all'})} />
      </div>

      {/* Event Details */}
      <Paper elevation={3} sx={{ p: 3, mb: 3 }}>
        <Typography variant="h4">{events[0].name}</Typography>
        <Typography variant="subtitle1">{events[0].date}</Typography>
        <Typography variant="subtitle2">{events[0].venue}</Typography>
      </Paper>

      {/* Seat Map */}
      <SeatMap 
        seats={events[0].seats.filter(seat => 
          (filters.seatType === 'all' || seat.type === filters.seatType)
        )}
        onSelect={handleSeatSelect}
      />

      {/* Booking Summary */}
      <BookingSummary selectedSeats={selectedSeats} />
    </div>
  );
};

export default App;
